import React from 'react';

export const Card = ({name, image, temperament}) => {
    return(
        <>
            <div>
                <h3>{name}</h3>
                <img src={image} alt="no cargo :(" width = '200px' height = '250px' />
                <h5>{temperament}</h5>
            </div>
        </>
    )
}
